import React, { useState, useEffect } from "react"
import "./cardgame.css"
import axios from "axios"
const cards = [
  {
    img: "https://avatars0.githubusercontent.com/u/810438?v=4",
    name: "vue"
  },
  {
    img: "./img/angular.svg",
    name: "angular"
  }
]
function Card(props) {
  return (
    <div>
      hi
      {/* <img
        src={
          "https://raw.githubusercontent.com/samiheikki/javascript-guessing-game/master/static/logos/" +
          props.name +
          ".png"
        }
      /> */}
      <img class="frontFace" src={require("./img/angular.svg")}></img>
    </div>
  )
}
function Cards() {
  return (
    <div>
      {cards.map((card) => (
        <Card {...card} />
      ))}
    </div>
  )
}
export default Cards

